INSERT INTO `notifications` VALUES ('01d5e015-83c4-44d0-95f8-acae64df4036','App\\Notifications\\NotifyBlogsPorAprobar','App\\Models\\User',1,'{\"id\":1,\"blogtitulo\":\"Gobierno cuestiona a Virgilio Saquicela y habla de \'intereses\' en juicio pol\\u00edtico\",\"blogdescripcion\":\"El ministro de Gobierno, Henry Cucal\\u00f3n, ratific\\u00f3 este lunes 15 de mayo de 2023 que el presidente Guillermo Lasso acudir\\u00e1 a la Asamblea Nacional el martes 16 para defenderse en el juicio pol\\u00edtico. El funcionario desacredit\\u00f3 a las autoridades del Legislativo.\",\"blogcontenido\":\"<p>Cucal\\u00f3n dijo en radio Democracia que la duda est\\u00e1 en saber cu\\u00e1l es el objetivo de los <strong>votos<\\/strong> que dieron ese resultado. \\\"\\u00bfVamos a tener <strong>dignatarios<\\/strong> que son t\\u00edteres de objetivos inconfesables entre los cuales est\\u00e1 la <strong>impunidad<\\/strong> o vamos a tener autoridades que trabajen en favor del <strong>inter\\u00e9s general<\\/strong>?\\\", cuestion\\u00f3.<\\/p><p>\\\"S\\u00ed, tengo un pacto con <strong>Unes<\\/strong> (Uni\\u00f3n por la Esperanza, corre\\u00edsmo), y lo digo al pa\\u00eds, y es la<strong> institucionalidad<\\/strong> del Ecuador y es la institucionalidad de la <a href=\\\"https:\\/\\/www.elcomercio.com\\/actualidad\\/politica\\/asamblea-instala-renueva-autoridades-posesiona-cpccs.html\\\"><strong>Asamblea<\\/strong>\\\"<\\/a>, reconoci\\u00f3 Saquicela en su discurso luego de ser posesionado.<\\/p><p>El Secretario de Estado sospecha que detr\\u00e1s de ese pacto podr\\u00eda estar una agenda de \\\"<strong>destrucci\\u00f3n<\\/strong>, de ingobernabilidad y anarqu\\u00eda (...) Ese es su <strong>\\u00fanico objetivo<\\/strong> o para lo que le han puesto ah\\u00ed. Ah\\u00ed no hay <strong>autonom\\u00eda<\\/strong> de pensamiento ni de acci\\u00f3n. Nulidad absoluta, aqu\\u00ed no nos vamos a<strong> enga\\u00f1ar<\\/strong>. Eso es lo que est\\u00e1 en juego, lo que est\\u00e1 encima de la mesa de la precaria <strong>institucionalidad <\\/strong>que tiene Ecuador\\\", critic\\u00f3.<\\/p><p>El funcionario del Ejecutivo dijo que no existi\\u00f3 una<strong> alternativa fuerte<\\/strong> que logre enfrentar la mayor\\u00eda en la Asamblea que sostiene a Saquicela. Mientras, el Gobierno estaba y sigue enfocado en la defensa de <a href=\\\"https:\\/\\/www.elcomercio.com\\/actualidad\\/guillermo-lasso-se-defendera-el-martes-16-de-mayo-a-las-1000-en-su-juicio-politico.html\\\"><strong>Lasso<\\/strong><\\/a>. \\\"Hay una mayor\\u00eda, no para destituir al Presidente, pero s\\u00ed para poner dignidades que han venido entorpeciendo los actos porque lo \\u00fanico que le interesa es la <strong>desestabilizaci\\u00f3n<\\/strong>\\\".<\\/p><p><img class=\\\"image_resized\\\" style=\\\"width:39.52%;\\\" src=\\\"data:image\\/jpeg;base64,\\/9j\\/4AAQSkZJRgABAQEASABIAAD\\/4RUJRXhpZgAATU0AKgAAAAgADgEAAAMAAAABCAAAAAEBAAMAAAABBVUAAAECAAMAAAADAAAAtgEGAAMAAAABAAIAAAESAAMAAAABAAEAAAEVAAMAAAABAAMAAAEaAAUAAAABAAAAvAEbAAUAAAABAAAAxAEoAAMAAAABAAIAAAExAAIAAAAfAAAAzAEyAAIAAAAUAAAA6wE7AAIAAAAOAAAA\\\\/2P\\/tAAxBZG9iZV9DTQAB\\/+4ADkFkb2JlAGSAAAAAAf\\/bAIQADAgICAkIDAkJDBELCgsRFQ8MDA8VGBMTFRMTGBEMDAwMDAwRDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAENCwsNDg0QDg4QFA4ODhQUDg4ODhQRDAwMDAwREQwMDAwMDBEMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwM\\/8AAEQgAWQCfAwEiAAIRAQMRAf\\/dAAQACv\\/EAT8AAAEFAQEBAQEBAAAAAAAAAAMAAQIEBQYHCAkKCwEAAQUBAQEBAQEAAAAAAAAAAQACAwQFBgcICQoLEAABBAEDAgQCBQcGCAUDDDMBAAIRAwQhEjEFQVFhEyJxgTIGFJGhsUIjJBVSwWIzNHKC0UMHJZJT8OHxY3M1FqKygyZEk1RkRcKjdDYX0lXiZfKzhMPTdePzRieUpIW0lcTU5PSltcXV5fVWZnaGlqa2xtbm9jdHV2d3h5ent8fX5\\/cRAAICAQIEBAMEBQYHBwYFNQEAAhEDITESBEFRYXEiEwUygZEUobFCI8FS0fAzJGLhcoKSQ1MVY3M08SUGFqKygwcmNcLSRJNUoxdkRVU2dGXi8rOEw9N14\\/NGlKSFtJXE1OT0pbXF1eX1VmZ2hpamtsbW5vYnN0dXZ3eHl6e3x\\/\\/aAAwDAQACEQMRAD8A66h5ZXVY3mva4f2T\\/wCZLiut0fZOuZ1AMNFznsAcQNlsZDP+jau0ob7APJc39dKDXm4mYOMik1viPp0Hz\\/eouq\\/zFBFLlMeY5P8AnlFZYfH\\/AKZVWuzzP4IzLDB1PPkipOLD4\\/8ATSNmnP8A0yhb3ef4J97