 legislativas<\\/strong> y <strong>presidenciales<\\/strong> para el resto de los <strong>respectivos per\\u00edodos<\\/strong>. \\\"Esta es una acci\\u00f3n decmocr\\u00e1tica, porque devuelve a los ecuatorianos el poder de decidir su futuro\\\".<\\/p><p>La activaci\\u00f3n de esta herramienta constitucional se pone en marcha luego de que se cumpliera la <strong>primera jornada del juicio pol\\u00edtico<\\/strong> en contra del Jefe de Estado que cerr\\u00f3 con el debate en el pleno de la Asamblea la noche del martes, 16 de mayo.<\\/p><p>Durante la intervenci\\u00f3n de varios de los legisladores que fueron parte del debate, se\\u00f1alaron que no temen a la muerte cruzada, hecho con el cual Lasso hab\\u00eda advertido activar previo a la jornada de su juicio pol\\u00edtico.<\\/p><div class=\\\"raw-html-embed\\\"><blockquote class=\\\"twitter-tweet\\\"><p lang=\\\"es\\\" dir=\\\"ltr\\\">He firmado el Decreto Ejecutivo 741, con el objetivo de disolver la Asamblea Nacional y solicitar al CNE se convoque a elecciones. <br><br>Ecuatorianas y ecuatorianos: esta es la mejor decisi\\u00f3n para darle una salida constitucional a la crisis pol\\u00edtica y <br>conmoci\\u00f3n interna que soporta\\u2026<\\/p>\\u2014 Guillermo Lasso (@LassoGuillermo) <a href=\\\"https:\\/\\/twitter.com\\/LassoGuillermo\\/status\\/1658805860410245120?ref_src=twsrc%5Etfw\\\">May 17, 2023<\\/a><\\/blockquote> <script async=\\\"\\\" src=\\\"https:\\/\\/platform.twitter.com\\/widgets.js\\\" charset=\\\"utf-8\\\"><\\/script><\\/div><p>&nbsp;<\\/p>\",\"categorie_id\":\"Entrevistas\",\"perfil\":\"UNION POR LA ESPERANZA UNION POR LA ESPERANZA\",\"perfilid\":1,\"user\":\"Super Admin\",\"date\":\"Blog Aprobado\"}',NULL,'2023-05-17 20:32:48','2023-05-17 20:32:48'),('a31b37f2-07a4-43bc-817c-3e9193562432','App\\Notifications\\NotifyBlogsPorAprobar','App\\Models\\User',4,'{\"id\":6,\"blogtitulo\":\"Guillermo Lasso activa la muerte cruzada; disuelve la Asamblea Nacional\",\"blogdescripcion\":\"El presidente Guillermo Lasso activ\\u00f3 la muerte cruzada este mi\\u00e9rcoles, 17 de mayo de 2023, por grave crisis pol\\u00edtica y conmoci\\u00f3n interna. El anuncio se lo dio en cadena nacional.\",\"blogcontenido\":\"<p>Lasso se\\u00f1al\\u00f3 que \\\"he decididio aplicar el art\\u00edculo 148 de la Constituci\\u00f3n que me otorga la factultad de disolver la Asamblea\\\".<\\/p><p>Adem\\u00e1s, puntualiz\\u00f3 que solicit\\u00f3 al Consejo Nacional Electoral (CNE) la convocatoria inmediata a <strong>elecciones legislativas<\\/strong> y <strong>presidenciales<\\/strong> para el resto de los <strong>respectivos per\\u00edodos<\\/strong>. \\\"Esta es una acci\\u00f3n decmocr\\u00e1tica, porque devuelve a los ecuatorianos el poder de decidir su futuro\\\".<\\/p><p>La activaci\\u00f3n de esta herramienta constitucional se pone en marcha luego de que se cumpliera la <strong>primera jornada del juicio pol\\u00edtico<\\/strong> en contra del Jefe de Estado que cerr\\u00f3 con el debate en el pleno de la Asamblea la noche del martes, 16 de mayo.<\\/p><p>Durante la intervenci\\u00f3n de varios de los legisladores que fueron parte del debate, se\\u00f1alaron que no temen a la muerte cruzada, hecho con el cual Lasso hab\\u00eda advertido activar previo a la jornada de su juicio pol\\u00edtico.<\\/p><div class=\\\"raw-html-embed\\\"><blockquote class=\\\"twitter-tweet\\\"><p lang=\\\"es\\\" dir=\\\"ltr\\\">He firmado el Decreto Ejecutivo 741, con el objetivo de disolver la Asamblea Nacional y solicitar al CNE se convoque a elecciones. <br><br>Ecuatorianas y ecuatorianos: esta es la mejor decisi\\u00f3n para darle una salida constitucional a la crisis pol\\u00edtica y <br>conmoci\\u00f3n interna que soporta\\u2026<\\/p>\\u2014 Guillermo Lasso (@LassoGuillermo) <a href=\\\"https:\\/\\/twitter.com\\/LassoGuillermo\\/status\\/1658805860410245120?ref_src=twsrc%5Etfw\\\">May 17, 2023<\\/a><\\/blockquote> <script async=\\\"\\\" src=\\\"https:\\/\\/platform.twitter.com\\/widgets.js\\\" charset=\\\"utf-8\\\"><\\/script><\\/div><p>&nbsp;<\\/p>\",\"categorie_id\":\"Entrevistas\",\"perfil\":\"UNION POR LA ESPERANZA UNION POR LA ESPERANZA\",\"perfilid\":1,\"user\":\"Super Admin\",\"date\":\"Blog Aprobado\"}',NULL,'2023-05-17 20:32:48','2023-05-17 20:32:48'),('a581dbb6-6bea-4b86-a67f-9337ad29d926','App\\Notifications\\NotifyBlogsPorAprobar','App\\Models\\User',1,'{\"id\":2,\"blogtitulo\":\"El segundo interpelante en el juicio pol\\u00edtico a Guillermo Lasso ser\\u00e1 Esteban Torres\",\"blogdescripcion\":\"El asamble\\u00edsta Esteban Torres (PSC) ser\\u00e1 interpelante en el juicio pol\\u00edtico contra el presidente de la Rep\\u00fablica, Guillermo Lasso, por el presunto delito de peculado, previsto para el martes 16 de mayo de 2023.\",\"blogcontenido\":\"<p>La designaci\\u00f3n del legislador se dio este s\\u00e1bado 13 de mayo. Los otros tres solicitantes del juicio, Pedro Zapata (PSC), Rodrigo Fajardo (separado de ID) y Mireya Pazmi\\u00f1o (separada de Pachakutik) decidieron que Torres sea el <strong>segundo interpelante<\\/strong>.<\\/p><p>Esta decisi\\u00f3n no se puede apelar y es <strong>totalmente v\\u00e1lida<\\/strong>, a pesar de que Torres no sea uno de los proponentes del proceso.<\\/p><p>La convocatoria para la sesi\\u00f3n del pleno para el juicio est\\u00e1 prevista para este domingo 14 de mayo. La&nbsp;<a href=\\\"https:\\/\\/www.elcomercio.com\\/actualidad\\/politica\\/asamblea-notificacion-lasso-juicio-politico.html\\\">Secretar\\u00eda General de la Asamblea notific\\u00f3<\\/a>&nbsp;al Primer Mandatario sobre el enjuiciamiento en su contra este jueves.<\\/p><p>El objetivo de este proceso busca la censura y destituci\\u00f3n de Lasso.<\\/p><p>&nbsp;<\\/p><p>Espacio Doble<\\/p><div class=\\\"raw-html-embed\\\"><blockquote class=\\\"twitter-tweet\\\"><p lang=\\\"es\\\" dir=\\\"ltr\\\">Mensajes que necesito que me lleguen <a href=\\\"https:\\/\\/t.co\\/lSLcsdv9hC\\\">pic.twitter.com\\/lSLcsdv9hC<\\/a><\\/p>\\u2014 Clonazepam\\ud83d\\udc41 (@PibeGrosoo) <a href=\\\"https:\\/\\/twitter.com\\/PibeGrosoo\\/status\\/1658149286884917250?ref_src=twsrc%5Etfw\\\">May 15, 2023<\\/a><\\/blockquote> <script async=\\\"\\\" src=\\\"https:\\/\\/platform.twitter.com\\/widgets.js\\\" charset=\\\"utf-8\\\"><\\/script><\\/div>\",\"categorie_id\":\"Fizcalisamos\",\"perfil\":\"UNION POR LA ESPERANZA UNION POR LA ESPERANZA\",\"perfilid\":1,\"user\":\"Super Admin\",\"date\":\"Blog Aprobado\"}','2023-05-16 04:13:55','2023-05-15 21:37:07','2023-05-16 04:13:55'),('b3294667-ad0c-4cea-b7e6-c7116f4a7c78','App\\Notifications\\NotifyBlogsPorAprobar','App\\Models\\User',2,'{\"id\":5,\"blogtitulo\":\"Decreto de la muerte cruzada est\\u00e1 listo, afirma Secretario Jur\\u00eddico de la Presidencia\",\"blogdescripcion\":\"Decreto de la muerte cruzada est\\u00e1 listo, afirma Secretario Jur\\u00eddico de la Presidencia\",\"blogcontenido\":\"<h1>Decreto de la muerte cruzada est\\u00e1 listo, afirma Secretario Jur\\u00eddico de la Presidencia<\\/h1>\",\"categorie_id\":\"Agenda\",\"perfil\":\"UNION POR LA ESPERANZA UNION POR LA ESPERANZA\",\"perfilid\":1,\"user\":\"Super Admin\",\"date\":\"Blog Aprobado\"}',NULL,'2023-05-16 03:45:55','2023-05-16 03:45:55'),('ef049ba7-188e-45b8-a251-81e45d9f7e49','App\\Notifications\\NotifyBlogsPorAprobar','App\\Models\\User',1,'{\"id\":3,\"blogtitulo\":\"Para editorial 1\",\"blogdescripcion\":\"Para editorial 1\",\"blogcontenido\":\"<p>Para editorial 1<\\/p>\",\"categorie_id\":\"Agenda\",\"perfil\":\"UNION POR LA ESPERANZA UNION POR LA ESPERANZA\",\"perfilid\":1,\"user\":\"Super Admin\",\"date\":\"Blog Aprobado\"}','2023-05-16 04:13:55','2023-05-16 03:25:14','2023-05-16 04:13:55');
